import React from 'react'
import styled from 'styled-components'
import FoodForm from '../components/FoodForm'

const FormSection = styled.div`
    height: 100vh;
    width: max-content;
`

const PreviewSection = styled.div`
    height: 100vh;
    width: max-content;
`

function Orders() {
    return (
        <FormSection>
            <FoodForm></FoodForm>
        </FormSection>
    )
}

export default Orders
